angular.module("sensinum.ngTsElasticCrud.tpl", []).run(["$templateCache", function($templateCache) {$templateCache.put("app/components/core/atec.template.html","<div class=\"ajax-list\"><div ng-if=\"list.getTitle() && templates.title\" ng-include=\"templates.title\"></div><div class=\"table-responsive\"><table class=\"table table-striped\"><thead ng-include=\"templates.header\"></thead><tbody><tr ng-if=\"!list.items.length\"><td colspan=\"{{ getColumnsCount() }}\"><small>{{ list.isFetchInProgress() ? \'Fetching data.Please wait...\' : \'No data to display\' }}</small></td></tr><tr ng-repeat=\"item in list.items\" ng-include=\"templates.row\"></tr></tbody><tfoot ng-if=\"templates.footer\" ng-include=\"templates.footer\"></tfoot></table></div><pre ng-if=\"debugOn\">\n{{ list.items | json }}\n</pre></div>");
$templateCache.put("app/components/filter/atec.filter.template.html","<input type=\"text\" ng-model=\"value\" ng-model-options=\"{ debounce : 250 }\" class=\"form-control input-sm\">");
$templateCache.put("app/components/item/atec.item.actions.template.html","<div class=\"action-buttons\"><a class=\"btn btn-sm {{ action.type ? \'btn-\' + action.type : \'btn-default\' }}\" ng-repeat=\"action in item.getActions()\" ng-bind-html=\"action.label\" ng-click=\"action.onClick($event, item)\"></a></div>");
$templateCache.put("app/components/title/atec.title.template.html","<div class=\"ajax-list-title container-fluid\"><div class=\"col-md-7\"><h1 class=\"page-header\">{{ list.title }}</h1></div><div class=\"text-right col-md-5\"><div class=\"global-actions action-buttons btn-group\" role=\"group\" aria-label=\"{{ list.title }} - Global actions\"><a class=\"btn {{ action.type ? \'btn-\' + action.type : \'btn-default\' }}\" ng-repeat=\"action in list.getActions(\'global\')\" ng-bind-html=\"action.label\" ng-click=\"action.onClick($event, item)\"></a></div></div></div>");
$templateCache.put("app/components/footer/atec.footer.pagination.template.html","<ul class=\"pagination pagination-sm\"><li ng-if=\"!list.paginationIsFirstPage()\"><a href=\"#\" ng-click=\"list.paginationGoPrev($event)\">&laquo;</a></li><li ng-class=\"{ \'active\' : page == list.paginationCurrentPage() }\" ng-repeat=\"page in list.paginationDisplayPages()\"><a href=\"#\" ng-click=\"list.paginationGoTo($event, page)\">{{ page }} <span ng-if=\"page == list.paginationCurrentPage()\" class=\"sr-only\">(current)</span></a></li><li ng-if=\"!list.paginationIsLastPage()\"><a href=\"#\" ng-click=\"list.paginationGoNext($event)\">&raquo;</a></li></ul>");
$templateCache.put("app/components/footer/atec.footer.template.html","<tr class=\"ajax-list-summary\" ng-if=\"templates.summary\" ng-include=\"templates.summary\"></tr><tr><td colspan=\"{{ getColumnsCount() }}\"><div class=\"container-fluid\"><div class=\"row\"><div class=\"col-md-4\"><button ng-if=\"list.hasAnyActions(\'group\')\" type=\"button\" class=\"btn btn-default\" bs-dropdown=\"list.getActions(\'group\')\" aria-haspopup=\"true\" aria-expanded=\"false\">Group actions {{ list.hasAnySelectedItems() ? \'(\' + list.getSelectedItemsCount() + \' items selected)\' : \'\' }} <span class=\"caret\"></span></button></div><div class=\"col-md-4 text-center\" ng-include=\"defaults.templates.pagination\"></div><div class=\"col-md-4 text-right\">{{ list.getMeta(\'display-from\') }} - {{ list.getMeta(\'display-to\') }} of {{ list.getMeta(\'display-total\') }} total</div></div></div></td></tr>");}]);